  true,\n\t\"url\": null,\n\t\"notes\": \"The MAI6NVANA or inst6_3d_ana_Nv data product
  is the MERRA Data Assimilation System 3-Dimensional instantaneous, on model levels,
  at native resolution. MERRA, or the Modern Era Retrospective-analysis for Research
  and Application, is a NASA reanalysis for the satellite era (30 years 1979-current)
  using the Goddard Earth Observing System Data Assimilation System Version 5 (GEOS-5
  DAS).n                                    n                                    This
  data product contains 2-dimensional and 3-dimensional fields that do not vary during
  the reanalysis. n                                    n                                    The
  data are on the GEOS-5 native 540 x 361 grid with 2/3&deg; longitude x 1/2&deg;
  latitude resolution.  File sizes are about 1347 Mbytes per day with the following
  times compacted into a daily file: 00, 06, 12, 18 GMT. Data are archived in the
  HDF-EOS (Grid) format, based on HDF4.\",\n\t\"license_title\": \"U.S. Government
